# Pyatiletka, Austrumsky Selsoviet, Iglinsky District, Republic of Bashkortostan

}}
Pyatiletka () is a rural locality (a village) in Austrumsky Selsoviet, Iglinsky District, Bashkortostan, Russia. The population was 238 as of 2010.
Geography
It is located 50&nbsp;km from Iglino and 14&nbsp;km from Austrum.
